import React, {useState} from 'react';
import Styles from './App.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
    // const [show, setShow] = useState(true);

    return (
        <Container>
            <Row>
                <Card style={{width: '18rem'}}>
                    <Card.Header>
                        this is Header
                    </Card.Header>
                    <Card.Img variant="top" src="http://exsoft.ir./upload/1583851767post.jpg"/>

                    <Card.Body>
                        <Card.Title>Card Title</Card.Title>
                        <Card.Text>
                            Some quick example text to build on the card title and make up the bulk of
                            the card's content.
                        </Card.Text>
                        <Card.Link href='#' variant="primary">Go somewhere</Card.Link>
                    </Card.Body>
                    {/*<Card.Divider><span>at ninth clock ago</span></Card.Divider>*/}
                    <Card.Footer className="blockquote-footer text-muted">footer <cite title="Source Title">Source Title</cite></Card.Footer>
                </Card>
            </Row>
            <Row>
                {
                }
                [
                'Primary',
                'Secondary',
                'Success',
                'Danger',
                'Warning',
                'Info',
                'Light',
                'Dark',
                ].map((variant, idx) => (
                <Card
                    bg={variant.toLowerCase()}
                    key={idx}
                    text={variant.toLowerCase() === 'light' ? 'dark' : 'white'}
                    style={{ width: '18rem' }}
                    className="mb-2"
                >
                    <Card.Header>Header</Card.Header>
                    <Card.Body>
                        <Card.Title>{variant} Card Title </Card.Title>
                        <Card.Text>
                            Some quick example text to build on the card title and make up the bulk
                            of the card's content.
                        </Card.Text>
                    </Card.Body>
                </Card>
                ));

            </Row>
        </Container>
    );
}

export default App;
